  return (
    <div className="f1 tc">
      <h1>Hello world</h1>
      <p>{props.greeting}</p>
    </div>
  );
};

class hello extends Component {
  render() {
    return (
      <div>
        <h1>Hello world</h1>
        <p>Darshan</p>
      </div>
    );
  }
}
